import React from 'react';

const OffersAndLink = ({ offers }) => {
  return (
    <div>
      {offers.map((offer, index) => (
        <div key={index}>
          <p className='name'>{offer.name}</p>
          <p className='welcome_bonus'>{offer.bonuses.welcome_bonus}</p>
          <a href={offer.link} target="_blank" rel="noopener noreferrer">Go to offer</a>
        </div>
      ))}
    </div>
  );
};

export default OffersAndLink;
